import React from "react";
import Experience from "./Experience";

function Education(){
    return(
        <>
            {/* <div className="container"> */}
                {/* <div className="row"> */}
                    {/* <div className="col-md-4"> */}
                        <h2>Skills</h2>
                        <ul>
                            <li>HTML</li>
                            <li>CSS</li>
                            <li>JavaScript</li>
                            <li>BootStrap</li>
                            <li>Reactjs</li>
                            <li>Nodejs</li>
                            <li>MySQL</li>
                            <li>MongoDB</li>
                        </ul>
                    {/* </div> */}
                {/* </div> */}
            {/* </div> */}
        </>
    )
}

export default Education;
